import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function Example(props) {
    const{closepop, Brand} = props;  
  return (
    <>
      <Modal show={true} onHide={closepop} backdrop={'static'} keyboard={false} centered={true} >
      <div className='bg-warning'>
        <Modal.Header closeButton className='border-0  bg-warning'>
         
        </Modal.Header>
        <Modal.Body>
        <h1 className='fs-4 '>{Brand}</h1></Modal.Body>
        </div>
        <Modal.Footer>
          <Button variant="primary" onClick={closepop}>
           OK
          </Button>
        </Modal.Footer>
       
      </Modal>
    </>
  );
}

export default Example;
